import React from 'react';
import './App.css';
//import {Link} from "react-router-dom" 
import {Link} from "react-scroll" 
//import {animateScroll as scroll } from "react-scroll";
import { Breadcrumb } from 'semantic-ui-react'

function Nav() {

    // Some styling
const navStyle = {
    color: 'white'
};

  return (
    <nav> 

            <ul  className = "nav-links">
                {/* This <Link> will help us make the Nav bar functional and actually useful. style= {NavStyle} is just some styling we are using 
                the "to" is what we are linking it to
                */}
            <Link 
                style ={navStyle} 
                activeClass="active" 
                to = "/Home"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
            >
                <li>
                    Home
                </li>
                </Link>

                <Link 
                    style ={navStyle}  
                    to = "/FAQ"
                    activeClass="active"
                    spy={true}
                    smooth={true}
                    offset={-70}
                    duration={500} 
                >
                <li> FAQ </li> 
                </Link>

            <Link 
                style ={navStyle} 
                to ="/schedule"
                activeClass="active"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500} 
            >
        <li >Schedule</li>
        </Link>

        <Link 
            style ={navStyle}  
            to = "/sponsor"
            activeClass="active"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500} 
        >
                <li>
                    Sponsors
                </li>
                </Link>

                <Link 
                    style ={navStyle}  
                    to = "/about"
                    activeClass="active"
                    spy={true}
                    smooth={true}
                    offset={-70}
                    duration={500} 
                >
                <li>
                    About
                </li>
                </Link>
            </ul>
     </nav>
  );
}

export default Nav;
